  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Minimum Data Set (MDS) is part of
  the federally mandated process for clinical assessment of all residents in Medicare
  or Medicaid certified nursing homes. This process provides a comprehensive assessment
  of each residents functional capabilities and helps nursing home staff identify
  health problems. These public use reports are meant to begin the process of sharing
  information from the national MDS database.</p>n\",\n\t\"license_title\": \"Other
